	        var cols_l = ga.length;
	        var valid_pos = [];
	        var rows_l;

	        for (var c = 1; c < cols_l; c++) {
	            rows_l = ga[c].length;
	            for (var r = 1; r <= rows_l; r++) {
	                var can_move_to = this.can_move_to({
	                    size_x: size_x,
	                    size_y: size_y
	                }, c, r);

	                if (can_move_to) {
	                    valid_pos.push({
	                        col: c,
	                        row: r,
	                        size_y: size_y,
	                        size_x: size_x
	                    });
	                }
	            }
	        }

